import React, { useContext } from "react";
import styled from "styled-components";
import MemberTemplate from "./MemberTemplate";

const MemberBlock = styled.div`
  width: 100vw;
  height: 100vh;
  background: white;
`;
const MemberHead = styled.div`
  width: auto;
  height: 10vh;
  background: #efe3e3;
  text-align: left;
  font-weight: bold;
  font-size: 3rem;
  padding-top: 20px;
  padding-left: 20px;
`;

function Member({ initMember }) {
  console.log(initMember);
  console.log(1);
  return (
    <MemberBlock>
      <MemberTemplate>
        <MemberHead>Student</MemberHead>
      </MemberTemplate>
    </MemberBlock>
  );
}

export default Member;
